import React, { Component } from 'react'

class Opinion extends Component {
	state = {
		good: 1,
		neutral: 1,
		bad: 1,
	}

	render() {
		const { good, neutral, bad } = this.state
		return (
			<div>
				<p> Please leave feetback</p >
				<button> {good}</button>
				<button> {neutral}</button>
				<button> {bad}</button>
				<p>Statistics</p>
				<div>
					{this.state.forEach(({ key }) => {
						<ul key={key}>
							<li>{key}</li>
						</ul>
					})}
				</div>
			</div>

		)

	}
}
export default Opinion;
